import React from "react";
import BuildPage from "../Build";

function Header() {
	return (
		<header>
			<h1>
				David Deitz
			</h1>
			<h4>Web Development</h4>
            <h5>Javascript, HTML, CSS, React, Node, MYSQL</h5>
			
		</header>

	);
}

export default Header;
